// ==UserScript==
// @name         GC URL Coord Autofill
// @namespace    http://tampermonkey.net/
// @version      1.3
// @description  efficiency for effectiveness' sake
// @author       Brian
// @match        https://www.geocaching.com/geocache/*
// @match        https://geocaching.com.au/dragonzone/game/mmmm2025/claims/*
// @match        https://geocaching.com.au/cache/*
// @updateURL    https://github.com/Brainiac03/GC-URL-Coord-Autofill/raw/main/main.user.js
// @downloadURL  https://github.com/Brainiac03/GC-URL-Coord-Autofill/raw/main/main.user.js
// @icon         data:image/png;base64,
// ==/UserScript==

const hostname = window.location.hostname;

if (hostname === 'geocaching.com.au') {

    if (window.location.href.includes('/corrected/#')) {
        // GENERAL GCA COORECTED COORDS
        const coordsInput = document.getElementById('coords');

        const urlParams = new URLSearchParams(window.location.hash.slice(1));
        const coords = urlParams.get('coords') || '';

        coordsInput.value = coords;

        // highlight input field
        coordsInput.style.border = "2px solid green";

    }
    if (window.location.href.includes('/mmmm2025/claims/#')){
        // MMMM 2025 CLAIMS
        const waypointSelect = document.querySelector('select[name="waypoint"]');
        const requirementSelect = document.querySelector('select[name="requirement"]');
        const coordsInput = document.querySelector('input[name="coords"]');
        const submitBtn = document.querySelectorAll('input[type="submit"]');

        // Extract coords from URL
        const urlParams = new URLSearchParams(window.location.hash.slice(1));
        const coords = urlParams.get('coords') || '';


        // Extract GA code
        const gaCode = urlParams.get('waypoint') || '';

        // Fill in the form fields
        waypointSelect.value = gaCode;
        waypointSelect.dispatchEvent(new Event('change', { bubbles: true }));

        requirementSelect.value = 'Solve';
        requirementSelect.dispatchEvent(new Event('change', { bubbles: true }));

        coordsInput.value = coords;

        const actualSubmit = submitBtn[1];
        actualSubmit.style.border = "2px solid green";
    }


} else if (hostname === 'www.geocaching.com') {
    // GENERAL GC CORRECTED COORDS

    var newCoordinates = "";
    var coords = "";

    function pollDOM() {
        const newCrd = document.getElementById('newCoordinates');

        if (newCrd != null) {
            // Do something with el
            newCrd.value = newCoordinates;

            let submitBtn = document.getElementsByClassName("btn-cc-parse")[0];
            submitBtn.click();
            let colSubmitBtn = document.getElementsByClassName("btn-cc-accept")[0];
            colSubmitBtn.style.border = "3px solid green";
        } else {
            setTimeout(pollDOM, 300); // try again in 300 milliseconds
        }
    }

    function updateCoordinates( newCoords ) {
        let crd = document.getElementById("uxLatLonLink");
        crd.click();

        newCoordinates = newCoords;

        pollDOM();
        console.debug("XX: " + newCoords);
    }

    function getCoordsFromURL() {

        if (window.location.href.indexOf("#coords=") != -1) { // guess who can't regex to save his life!! (this should probably be in the @match but ehhhh)
            var hashParams = window.location.hash.substr(1).split(); // substr(1) to get rid of the `#`
            let coords = decodeURIComponent(hashParams[0].split('=')[1]);; // creates array between coords= and actual coords - we only want the second bit
            updateCoordinates(coords)
        }

    }

    getCoordsFromURL()
}
